import React, {Component} from 'react';
import ChatBot from 'react-native-chatbot';
import PropTypes from "prop-types";
import CourseKeywords from './CourseKeywords';
import LoadingWheel from "../../components/LoadingWheel";
import chatbotPhrases from "../../assets/ChatbotPhrases.json";

class ChatbotPage extends Component {
    constructor() {
        super();
        this.state = {
            userCategoryIndex: null,
        }
    }

    static propTypes = {
        keywordCategories: PropTypes.array.isRequired,
        ageCategories: PropTypes.array.isRequired,
        categoriesOptions: PropTypes.array.isRequired
    };

    render() {
        if (this.props.ageCategories.length !== 0 && this.props.keywordCategories.length !== 0 && this.props.categoriesOptions.length !== 0) {
            return (
                    <ChatBot
                        botBubbleColor = '#0066cc'
                        botAvatar = 'data:image/jpeg;base64,'
                        userAvatar = 'data:image/png;base64,'

                        steps={[
                            {
                                id: '0_msg_welcome',
                                message: chatbotPhrases['0_msg_welcome'][Math.floor(Math.random()*chatbotPhrases.numberOfPhrases)],
                                trigger: '1_msg_welcome',
                            },
                            {
                                id: '1_msg_welcome',
                                message: chatbotPhrases['1_msg_welcome'][Math.floor(Math.random()*chatbotPhrases.numberOfPhrases)],
                                trigger: '2_msg_welcome',
                            },
                            {
                                id: '2_msg_welcome',
                                message: 'How old are you?',
                                trigger: '3_user_age',
                            },
                            {
                                id: '3_user_age',
                                user: true,
                                validator: (value) => {
                                    if (isNaN(value)) {
                                        return 'Input should be a number';
                                    }
                                    else if (value < 1 || value > 100) {
                                        return 'Number should be between 1 and 100';
                                    }
                                    return true;
                                },
                                trigger: '4_msg_age',
                            },
                            {
                                id: '4_msg_age',
                                message: ({previousValue, steps}) => chatbotPhrases['confirmation'][Math.floor(Math.random()*chatbotPhrases.numberOfPhrases)] + previousValue + '.',
                                trigger: '5_msg_category',
                            },
                            {
                                id: '5_msg_category',
                                message: chatbotPhrases['5_msg_category'][Math.floor(Math.random()*chatbotPhrases.numberOfPhrases)],
                                trigger: '6_options_category',
                            },
                            {
                                id: '6_options_category',
                                options: this.props.categoriesOptions
                            },
                            {
                                id: '7_msg_category',
                                message: ({previousValue, steps}) => chatbotPhrases['confirmation'][Math.floor(Math.random()*chatbotPhrases.numberOfPhrases)] + this.props.keywordCategories[previousValue].description + '.',
                                trigger: '8_msg_search',
                            },
                            {
                                id: '8_msg_search',
                                message: chatbotPhrases['8_msg_search'][Math.floor(Math.random()*chatbotPhrases.numberOfPhrases)],
                                trigger: '9_custom_result',
                            },
                            {
                                id: '9_custom_result',
                                component: (
                                    <CourseKeywords keywordCategories={this.props.keywordCategories}
                                                    ageCategories={this.props.ageCategories}></CourseKeywords>
                                ),
                                trigger: '10_msg_result'
                            },
                            {
                                id: '10_msg_result',
                                message: 'If you like to get more information, click on a course.',
                                end: true
                            }
                        ]}
                    />
                )
        } else {
            return (
                <LoadingWheel/>
            )
        }
    }
}

export default ChatbotPage;

